"              Weight",
"             </span>",
"            </td>",
"            <td align=\"left\" nowrap=\"nowrap\" valign=\"top\" width=\"5%\">",
"             &nbsp;",
"             <input name=\"Weight_param\" onblur=\"BodyMassIndexGirlsPatient_fx(); minMaxCheck();\" onchange=\"BodyMassIndexGirlsPatient_fx();\" size=\"6\" type=\"text\" value=\"\"/>",
"            </td>",
"            <td align=\"left\" valign=\"top\" width=\"115\">",
"             <select class=\"medCalcFontSelect\" name=\"Weight_unit\" onchange=\"BodyMassIndexGirlsPatient_fx();\" style=\"width:105px;\">",
"              <option value=\"2.20462262184878|0|kg\">",
"               kg",
"              </option>",
"              <option selected=\"selected\" value=\"1|0|lb\">",
