"        <span class=\"medCalcFontTitleBox\">",
"         BMI Percentile Interpretation",
"        </span>",
"       </td>",
"      </tr>",
"     </table>",
"     <br/>",
"     &nbsp;",
"     <br/>",
"     <center>",
"      <table border=\"1\" cellpadding=\"4\" cellspacing=\"0\" summary=\"RRTable\">",
"       <tr id=\"rr1_1\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"         <span class=\"medCalcFontOneBold\">",
"          Percentile &lt; 5:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Underweight",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_2\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"         <span class=\"medCalcFontOneBold\">",
"          Percentile &gt;= 5 and &lt; 85:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Healthy weight",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_3\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"         <span class=\"medCalcFontOneBold\">",
"          Percentile &gt;= 85 and &lt; 95:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Overweight",
"         </span>",
"        </td>",
"       </tr>",
"       <tr id=\"rr1_4\">",
"        <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"         <span class=\"medCalcFontOneBold\">",
"          Percentile &gt;= 95:",
"         </span>",
"        </td>",
"        <td align=\"left\" style=\"border-left: 0px;\">",
"         <span class=\"medCalcFontOne\">",
"          Obesity",
"         </span>",
"        </td>",
"       </tr>",
"      </table>",
"     </center>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
