"   <div class=\"lgnd\">",
"    The pathologic changes of DDH occur along a spectrum in time and severity, as depicted in images A through C above. Changes begin with laxity of the hip joint capsule (A), which permits the femoral head to move out of the acetabulum. This movement results in eversion of the labrum and elongation of the ligamentum teres (B), eventually preventing relocation of the femoral head into the acetabulum (C).",
